import './App.css'
import {BsFillMoonStarsFill} from 'react-icons/bs';
import {
  AiFillTwitterCircle,
  AiFillLinkedin,
  AiFillGithub,
} from "react-icons"




//IMPORTS ARE DONE ABOVE THIS LINE


function App() {

  //return starts here
  return (
    <div className="App bg-white px-10 ">
      <section className=" h-screen">
        <nav className="py-10 mb-12 flex justify-between">
          <h1 className="text-xl font-bold">Mambwe</h1>
          <ul className="flex items-center">
            <li>
              <BsFillMoonStarsFill className="cursor-pointer text-2xl" />
            </li>
            <li>
              <a
                className="bg-gradient-to-r from-cyan-500 to-teal-500 text-white px-4 py-2 rounded-md ml-8"
                href="http://linkedin.com/mikemambwe"
              >
                Resume`
              </a>
            </li>
          </ul>
        </nav>
        {/**THE NAVBAR ENDS RIGHT HERE**/}
        {/**THE HERO STARTS HERE**/}
        <div>
          <h2>Mike Mambwe</h2>
          <h3>Software Developer and Designer</h3>
          <p></p>
        </div>
        {/**BUTTONS START HERE**/}
        <div>

        </div>
      </section>
    </div>
  );
}

export default App;
